uction[house$construction == 1] = \"Yes\"\n","\n","#Changing 0 and 1 to No and Yes in the air_cond column\n","house$air_cond[house$air_cond == 0] = \"No\"\n","house$air_cond[house$air_cond == 1] = \"Yes\"\n","\n","#Changing 2,3,and 4 to Gas, Electric and Oil in the fuel column\n","house$fuel[house$fuel == 2] = \"Gas\"\n","house$fuel[house$fuel == 3] = \"Electric\"\n","house$fuel[house$fuel == 4] = \"Oil\"\n","\n","#Changing 2,3,and 4 to Hot Air, Hot Water, Electric in the heat column\n","house$heat[house$heat == 2] = \"Hot Air\"\n","house$heat[house$heat == 3] = \"Hot Water\"\n","house$heat[house$heat == 4] = \"Electric\"\n","\n","#Changing 1,2, and 3 to None, Private, Public in the sewer column\n","house$sewer[house$sewer == 1] = \"None\"\n","house$sewer[house$sewer == 2] = \"Private\"\n","house$sewer[house$sewer == 3] = \"Public\"\n","\n","#Creating a newprice column for our convenience in data visualization\n","#Here we divide the price which is in the first column, to 1000\n","#The newprice is in the last column of our data frame\n","house$newprice <- house[,1]/1000\n"]},{"cell_type":"markdown","id":"prospective-retirement","metadata":{"papermill":{"duration":0.015247,"end_time":"2022-03-02T14:09:12.826574","exception":false,"start_time":"2022-03-02T14:09:12.811327","status":"completed"},"tags":[]},"source":["Again, notice that a column named** \"newprice**\" is added for convenience in visualizing the data since too many zeroes can get in the way. \n","\n","*I am still learning **tidyr and dplyr** so please if you have a better code for fixing the data, just comment it!*"]},{"cell_type":"code","execution_count":4,"id":"operational-future","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-03-02T14:09:12.866591Z","iopub.status.busy":"2022-03-02T14:09:12.864237Z","iopub.status.idle":"2022-03-02T14:09:12.916458Z","shell.execute_reply":"2022-03-02T14:09:12.909116Z"},"papermill":{"duration":0.074586,"end_time":"2022-03-02T14:09:12.916664","ex