 the title, y,and x labels\n","a4 <- a3 + labs(title = \"Distribution of House Prices\",\n","                x = \"House Price in Thousands\", y = \"Number of Houses\")\n","\n","#Following a theme in R for design purposes\n","a5 <- a4 + theme_stata() \n","\n","#Adjusting the position of values in the y-axis, making the title bold\n","a6 <- a5 + theme(axis.text.y = element_text(hjust = 0.5), plot.title = element_text(face = \"bold\"))\n","\n","#Output\n","a6"]},{"cell_type":"markdown","id":"aggressive-dominican","metadata":{"papermill":{"duration":0.017806,"end_time":"2022-03-02T14:09:13.754993","exception":false,"start_time":"2022-03-02T14:09:13.737187","status":"completed"},"tags":[]},"source":["****Possible observations in the graph:****\n","* There is a concentration of values in houses where the price range is around 200 000 dollars.\n","* The graph is skewed to the right ot positively skewed.\n","* This means that when we pick a measure of central tendency, each of them will be found around the 200 000 dollar region."]},{"cell_type":"markdown","id":"iraqi-walker","metadata":{"papermill":{"duration":0.019232,"end_time":"2022-03-02T14:09:13.793898","exception":false,"start_time":"2022-03-02T14:09:13.774666","status":"completed"},"tags":[]},"source":["# **2. Frequency polygon**\n","* It is similar to the histogram, this is used when dealing with continuous variables\n","* An adavantage of this graph to the histogram is that it allows the possibility of constructing two or more frequency distributions on the same plot area.\n","* In this example, a frequency polygon is constructed with respect to the presence of an airconditioner in the house."]},{"cell_type":"code","execution_count":6,"id":"dominant-motorcycle","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-03-02T14:09:13.833246Z","iopub.status.busy":"2022-03-02T14:09:13.831755Z","iopub.status.idle":"2022-03-02T14:09:14.404288Z","shell.execute_reply":"2022-03-02T14:09:14.403614Z"},"pape