AEK8APMSBbKxxnEzAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["#Creating a frequency polygon, color of a line correspond whether a house has an airconditioner or not\n","#bins correspond to the variation of the graph\n","b1 <- ggplot(data = house, aes(x=newprice, col = air_cond)) + geom_freqpoly(bins = 50)\n","\n","#Modifying the x axis where there must be a dollar sign for the values.\n","#The values must range from 0 to 800 with 100 as an interval\n","b2 <- b1 + scale_x_continuous(labels = dollar, breaks = seq(0, 800, 100))\n","\n","#Modifying the y axis where the graph must range from 0 to 180 with 20 as an interval\n","#limits refer to the lowest and highest value in the y axis\n","b3 <- b2 + scale_y_continuous(breaks = seq(0,180,20), limits = c(0, 180))\n","\n","#Adding and modifying the title, y,and x labels, and the label\n","b4 <- b3 + labs(title = \"Distribution of House Prices in the Presence of an Air Conditioner\",\n","                x = \"House Price in Thousands\", y = \"Number of Houses\",\n","               color = \"Does the house have an air conditioner?\")\n","\n","#Following a theme in R and changing the color of the lines for design purposes\n","b5 <- b4 + theme_stata() + scale_color_manual(values = c(\"#d8031c\", \"#01016f\")) \n","\n","#Adjusting the position of values in the y-axis, making the title bold\n","b6 <- b5 + theme(axis.text.y = element_text(hjust = 0.5), plot.title = element_text(face = \"bold\"))\n","\n","#Output\n","b6"]},{"cell_type":"markdown","id":"determined-oklahoma","metadata":{"papermill":{"duration":0.019903,"end_time":"2022-03-02T14:09:14.44688","exception":false,"start_time":"2022-03-02T14:09:14.426977","status":"completed"},"tags":[]},"source":["**Possible observations in the graph:**\n","* Both observations are positively skewed or skewed to the right.\n","* Houses that do not have an air conditioner has a curve that is leptokurtic. This means that its higher and sharper peak indicates a greater concentration of observations but it has thicker tails that suggest the presence of observations that are extremely different from the mean.\n","* Houses that have an air conditioner has a curve that is platykurtic. This indicates a reduced amount of concentration of observations. Its thinner tails suggest that there are few or no observations that are extremely different from the mean."]},{"cell_type":"markdown","id":"antique-layer","metadata":{"papermill":{"duration":0.020473,"end_time":"2022-03-02T14:09:14.487503","exception":false,"start_time":"2022-03-02T14:09:14.46703","status":"completed"},"tags":[]},"source":["# **3. Bar Plot**\n","* This is used when dealing with categorical variables.\n","* In this example, sewer type is the categorical variable being used.\n","* Other categorical variables in the data are waterfront,construction, air_cond, fuel, heat,\n","fireplace, bathrooms, room."]},{"cell_type":"code","execution_count":7,"id":"weird-classroom","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-03-02T14:09:14.534591Z","iopub.status.busy":"2022-03-02T14:09:14.532623Z","iopub.status.idle":"2022-03-02T14:09:14.981254Z","shell.execute_reply":"2022-03-02T14:09:14.979409Z"},"papermill":{"duration":0.473183,"end_time":"2022-03-02T14:09:14.981413","exception":false,"start_time":"2022-03-02T14:09:14.50823","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3xN9x/H8e9N7s2UkIgkCGLGjhlq12yp0dqKKtWiaClFUdQqWqP1Q+2iVqhZ\nexa1W7EjJEbIMCJCkpvc8fvjRqohEZF7T+7X6/noH+d+z7ifc+9p7tsZ368q+lGcAAAAgPWz\nUboAAAAAZA+CHQAAgCQIdgAAAJIg2AEAAEiCYAcAACAJgh0AAIAkCHYAAACSINgBAABIgmAH\nAAAgCYIdAACAJAh2AAAAkiDYAQAASIJgBwAAIAmCHQAAgCQIdgAAAJIg2AEAAEiCYAcAACAJ\ngh0AAIAkCHYAAACSINgBAABIgmAHAAAgCYIdAACAJAh2AAAAkiDYAQAASIJgBwAAIAmCHQAA\ngCQIdgAAAJIg2AEAAEhCrXQBQE53oGv/IWGPM7Nkr/Xz+no7mLseczMatJsXLftt18XwqEc2\ndppGS6aPK+SU4f