FwIAoBikvzbhr8WKSWbU\nV2sDw0gkkqC7d7MEAnkXAgCgAJS53EZNmrBYLHkXAnKDYAcAAADAELh5AgAAAIAhEOwAAAAA\nGALBDgAAAIAhEOwAAAAAGALBDgAAAIAhEOwAAAAAGALBDgAAAIAhEOwAAAAAGALBDgAAAIAh\nEOwAAAAAGALBDgAAAIAhEOwAAAAAGALBDgAAAIAhEOwAAAAAGALBDgAAAIAhEOwAAAAAGALB\nDgAAAIAhEOwAAAAAGALBDgAAAIAhEOwAAAAAGALBDgAAAIAhEOwAAAAAGALBDgAAAIAhEOwA\nAAAAGALBDgAAAIAhEOwAAAAAGALBDgAAAIAh/g+6bIXi1KwoVAAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["#Creating a bar plot and adding an outline to the rectangles\n","c1 <- ggplot(data=house, aes(x = sewer, fill = sewer)) + geom_bar(col = \"black\")\n","\n","#Modifying the y axis where the graph must range from 0 to 1250 with 250 as an interval\n","#limits refer to the lowest and highest value in the y axis\n","c2 <- c1 + scale_y_continuous(breaks = seq(0,1250,250), limits = c(0, 1250))\n","\n","#Adding and modifying the title, y,and x labels, and the legend label\n","c3 <- c2 + labs(title = \"Type of Sewer Used in a House\",\n","                x = \"Sewer Type\", y = \"Number of Houses\",\n","               fill = \"Sewer Type\")\n","\n","#Following a theme in R and changing the color of the rectangles for design purposes\n","c4 <- c3 + theme_stata() + scale_fill_manual(values = c(\"#fbc93d\",\"#6cc0e5\",\"#fb4f4f\"))\n","\n","#Adjusting the position of values in the y-axis, making the title bold\n","c5 <- c4 + theme(axis.text.y = element_text(hjust = 0.5), plot.title = element_text(face = \"bold\"))\n","\n","#Output\n","c5"]},{"cell_type":"markdown","id":"blind-bracelet","metadata":{"papermill":{"duration":0.022184,"end_time":"2022-03-02T14:09:15.02548","exception":false,"start_time":"2022-03-02T14:09:15.003296","status":"completed"},"tags":[]},"source":["**Possible observations in the graph:**\n","* There are more public sewers than private sewers in the data.\n","* If you take a house in the data, it is more likely that it is using a public sewer."]},{"cell_type":"markdown","id":"general-contrast","metadata":{"papermill":{"duration":0.022497,"end_time":"2022-03-02T14:09:15.069333","exception":false,"start_time":"2022-03-02T14:09:15.046836","status":"completed"},"tags":[]},"source":["# **4. Scatter plot**\n","* This is used to see what kind of relationship a variable has to another variable.\n","* The smooth line is used when conducting a linear regression.\n","* In this example, the relationship between the price and the living area is observed."]},{"cell_type":"code","execution_count":8,"id":"delayed-consequence","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-03-02T14:09:15.118Z","iopub.status.busy":"2022-03-02T14:09:15.115808Z","iopub.status.idle":"2022-03-02T14:09:16.807229Z","shell.execute_reply":"2022-03-02T14:09:16.807721Z"},"papermill":{"duration":1.717721,"end_time":"2022-03-02T14:09:16.807907","exception":false,"start_time":"2022-03-02T14:09:15.090186","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["`geom_smooth()` using formula 'y ~ x'\n","\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd1wT5x8H8O9d2BtBQEVFWa46EXfdaN17Va171TqqrfvnqKu21Wrd29aBeys4\ncIsDUHCBAxVZAopsQpK73x8BxAAaEHJc+LxfvnyF55Ljk9xD8s09d88xMYlJBAAAAADixwod\nAAAAAACKBgo7AAAAAC2Bwg4AAABAS6CwAwAAANASKOwAAAAAtAQKOwAAAAAtgcIOAAAAQEug\nsAMAAADQEijsAAAAALQECjsAAAAALYHCDgAAAEBLoLADAAAA0BIo7AAAAAC0BAo7AAAAAC2B\nwg4AAABAS6CwAwAAANASKOwAAAAAtAQKOwAAAAAtgcIOAAAAQEugsAMAAADQEijsAAAAALQE\nCjsAAAAALYHCDgAAAEBLoLADAAAA0BIo7AAAAAC0BAo7AAAAAC2Bwg4AAABAS6CwAwAAANAS\nOkIHgDzI0183bjs/v6W6xuaOjhXrfttmyoD6OkzB1hx1bUXXmY+JSEe//C2fpV+ZU+n941Ue\nowOJiJUY3bm6vkjW+fUK9EyL6Slw8gT3lpNztzOMxMrOtnIlu/qtW4/s8k1BN2JpVhwdOE/R\nd/7sMvWh8va8k5u6l9FXuUO/NiNDpQoisnSZen5HneJLohlpcRdbdP8vdzvL6tvY2zpUsmvX\nu1cPdzt1VlUy3xCKVvZzZFi9u9c2f+aeOd/Ma01ZsrNvBXVWW4iXrgS+7NHXV3WZEai8rWvs\neP3cPImwgUoN7LETH1lKQnDQQ8+1a3r8tFfKCZ0GCo7nFXFRkf63A7Ys/6vjD6seJsuETgSQ\nN46TRoeF3bp+Z/HUmUPmnZLzQgcC8