oth line and removing the error that is why se = F\n","d2 <- d1 + geom_smooth(method = \"lm\", se = F)\n","\n","#Modifying the y axis where the graph must range from 0 to 800 with 100 as an interval, adding $ to the y values\n","#limits refer to the lowest and highest value in the y axis\n","d3 <- d2 + scale_y_continuous(labels = dollar, breaks = seq(0,800,100), limits = c(0, 800))  \n","\n","#Modifying the x axis where the graph must range from 0 to 5500 with 500 as an interval\n","#limits refer to the lowest and highest value in the x axis\n","d4 <- d3 + scale_x_continuous( breaks = seq(0,5500,500), limits = c(0, 5500))\n","\n","#Adding and modifying the title, y,and x labels\n","d5 <- d4 + labs(title = \"Relationship Between the House Price and Living Area\",\n","                x = \"Living Area in Square Meters\", y = \"House Price in Thousands\")\n","\n","#Following a theme in R and changing the color of the lines for design purposes\n","d6 <- d5 + theme_stata() \n","\n","#Adjusting the position of values in the y-axis, making the title bold\n","d7 <- d6 + theme(axis.text.y = element_text(hjust = 0.5), plot.title = element_text(face = \"bold\"))\n","\n","# Output\n","d7"]},{"cell_type":"markdown","id":"southern-stroke","metadata":{"papermill":{"duration":0.026946,"end_time":"2022-03-02T14:09:16.862728","exception":false,"start_time":"2022-03-02T14:09:16.835782","status":"completed"},"tags":[]},"source":["**Possible observations in the graph:**\n","* House price and living area has a positive linear relationship since the line slopes upward to the right.\n","* This means that as living area increases, house price increases.\n"]},{"cell_type":"markdown","id":"fifty-tomato","metadata":{"papermill":{"duration":0.024555,"end_time":"2022-03-02T14:09:16.912494","exception":false,"start_time":"2022-03-02T14:09:16.887939","status":"completed"},"tags":[]},"source":["# **5. Boxplot**\n","* This is useful if the user wants to display the location, spread, symmetry, extremes, and outliers of the data\n","* The line inside the rectangle shows the location of the median\n","* The sides of the rectangle are the first and third quartiles.\n","* First quartile is the value where at least 25% of the observations are less than or equal to it and the same time, at least 75% of the observations are greater than or equal to it.\n","* Third quartile is the value where at least 75% of the observations are less than or equal to it and the same time, at least 25% of the observations are greater than or equal to it.\n","* The length of the rectangle represents the magnitude of the interquartile range, a measure of dispersion which is the difference between the third quartile and first quartile.\n","* The relative position of the line inside the rectangle to its sides gives an idea on the degree and direction of symmetry.\n","* The outliers, which are the extremely small or large values are the dots in the graph.\n","* If there are no dots in the graph,the whiskers indicate the respective values of both extremes."]},{"cell_type":"code","execution_count":9,"id":"encouraging-particle","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-03-02T14:09:16.968605Z","iopub.status.busy":"2022-03-02T14:09:16.96768Z","iopub.status.idle":"2022-03-02T14:09:17.462832Z","shell.execute_reply":"2022-03-02T14:09:17.461697Z"},"papermill":{"duration":0.525797,"end_time":"2022-03-02T14:09:17.463281","exception":false,"start_time":"2022-03-02T14:09:16.937484","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd1wT5x8H8O9dFgRQ2YigVBDEAe696sK9xfFzW1v33tpad6u2jrrqLnXPunFb\nlWLdW5ShMmSJiMxAkvv9EUQMBIMlORI+71dffYXncpdv7pLzkxvPw8S9TyYAAAAAMHws3wUA\nAAAAQNFAsAMAAAAwEgh2AAAAAEYCwQ4AAADASCDYAQAAABgJBDsAAAAAI4FgBwAAAGAkEOwA\nAAAAjASCHQAAAICRQLADAAAAMBIIdgAAAABGAsEOAAAAwEgg2AEAAAAYCQQ7AAAAACOBYAcA\nAABgJBDsAAAAAIwEgh0AAACAkUCwAwAAADASCHYAAAAARgLBDgAAAMBIINgBAAA