difying the title, y,and x labels, and the legend label\n","e3 <- e2 + labs(title = \"House Prices with Respect to the Type of Fuel Used\",\n","                x = \"Type of Fuel\", y = \"House Price in Thousands\", fill = \"Type of Fuel\")\n","\n","#Following a theme in R and changing the color of the rectangles for design purposes\n","e4 <- e3 + theme_stata() + scale_fill_manual(values = c(\"#daa520\",\"#3d69c5\", \"#a7a7a6\")) \n","\n","#Adjusting the position of values in the y-axis, making the title bold\n","e5 <- e4 + theme(axis.text.y = element_text(hjust = 0.5), plot.title = element_text(face = \"bold\"))\n","\n","#output\n","e5\n"]},{"cell_type":"markdown","id":"usual-executive","metadata":{"papermill":{"duration":0.029036,"end_time":"2022-03-02T14:09:17.520524","exception":false,"start_time":"2022-03-02T14:09:17.491488","status":"completed"},"tags":[]},"source":["**Possible observations in the graph:**\n","* The distribution of the house prices in every type of fuel is skewed to the right because the line inside the rectangle is closer to the lower side of the rectangle than its upper side.\n","* The house prices when using an electric fuel are not as varied as the gas and oil fuel since it has the smallest rectangle.\n","* The upper 25% of house prices are more varied in a gas fuel because it has the longest upper whisker among the two."]},{"cell_type":"markdown","id":"informational-murray","metadata":{"papermill":{"duration":0.026297,"end_time":"2022-03-02T14:09:17.575529","exception":false,"start_time":"2022-03-02T14:09:17.549232","status":"completed"},"tags":[]},"source":["**References:**\n","* Almeda, J. V., Capistrano, T. G., &amp; Sarte, G. F. (2010). Elementary Statistics. Diliman, Quezon City: University of the Philippines Press.\n","* Ggplot2 Tutorial | ggplot2 In R Tutorial | Data Visualization In R | R Training | Edureka. (2017, November 20). Retrieved March 29, 2021, from https://www.youtube.com/watch?v=N5gYo43oLE8\n","* Make Beautiful Graphs 